import { jsPDF } from 'jspdf';
var font =
	'';
var callAddFont = function () {
	this.addFileToVFS('Tajawal-Bold-normal.ttf', font);
	this.addFont('Tajawal-Bold-normal.ttf', 'Tajawal-Bold', 'normal');
};

jsPDF.API.events.push(['addFonts', callAddFont]);

export default function setFont(doc) {
	doc.addFileToVFS('Tajawal-Bold-normal.ttf', font);
	doc.addFont('Tajawal-Bold-normal.ttf', 'Tajawal-Bold', 'normal');
	doc.setFont('Tajawal-Bold');
}
